import React, {Component} from "react";

class Contact extends Component {

    state = {
        contacts : [
            {num : '+216 1684984'}
        ]
    }

    render (){
        return (
            <div className="row mx-5 my-3">
                <input className="col-auto form-control w-50 me-3" /> 
                <input type="button" value='+ ADD' className="col-auto btn btn-success" />
                <br />
                <h1>Contacts :</h1>
                <ul>
                    {
                        this.state.contacts.map(
                            (contact) =>{
                                <li>{contact.num}</li>
                            } 
                        )
                    }
                </ul>
            </div>
        );
    }
}

export default Contact;
